import { logInUser, logOutUser } from "../actions/authorizeActions.js";
import { ACCESS_TOKEN } from "../Components/Constants/index.js";

var jwt = require("jsonwebtoken");

let token = localStorage.getItem();
export function authorizeReducer(state, { type, payload }) {
  switch (type) {
    default:
      return state;
  }
}
